import React from "react";
import {
  Dialog,
  DialogContent,
  DialogTitle,
  Typography,
  DialogActions,
  Button,
  Grid,
  Switch,
} from "@material-ui/core";

//form
import InputTextField from "./Form/InputTextField";

function DialogEditUsers(props) {
  let params = new URLSearchParams(props);
  console.log("ini props dialog =>", props, params.get("users"));

  return (
    <Dialog open={true} aria-labelledby="form-dialog-edit-users" fullWidth>
      <DialogTitle>
        <Typography variant="h4">
          <b> Edit Data</b>
        </Typography>
      </DialogTitle>
      <DialogContent>
        <Grid container>
          <Grid item xs={12}>
            <Typography>Name</Typography>
            <InputTextField fullWidth keys="name" />
          </Grid>
          <Grid item xs={12}>
            <InputTextField fullWidth keys="comment" />
          </Grid>
          <Grid item xs={12}>
            <Switch name="checkedA" />
          </Grid>
        </Grid>
      </DialogContent>
      <DialogActions>
        <Button color="primary">Cancel</Button>
        <Button color="primary">Subscribe</Button>
      </DialogActions>
    </Dialog>
  );
}

export default DialogEditUsers;
